  nameWithType: com.azure.cosmos.implementation.guava25.collect
  fullName: com.azure.cosmos.implementation.guava25.collect
  type: Namespace
  summary: >-
    This package contains generic collection interfaces and implementations, and other utilities for
     working with collections. It is a part of the open-source <a href="http://github.com/google/guava">Guava</a> library.

     <h2>Collection Types</h2>

     <dl>
       <dt><xref uid="com.azure.cosmos.implementation.guava25.collect.BiMap" data-throw-if-not-resolved="false">com.azure.cosmos.implementation.guava25.collect.BiMap</xref>
       <dd>An extension of <xref uid="java.util.Map" data-throw-if-not-resolved="false">java.util.Map</xref> that guarantees the uniqueness of its values as well
           as that of its keys. This is sometimes called an "invertible map," since the restriction on
           values enables it to support an <xref uid="com.azure.cosmos.implementation.guava25.collect.BiMap#inverse" data-throw-if-not-resolved="false">inverse
           view</xref> -- which is another instance of <code>BiMap</code>.
       <dt><xref uid="com.azure.cosmos.implementation.guava25.collect.Multiset" data-throw-if-not-resolved="false">com.azure.cosmos.implementation.guava25.collect.Multiset</xref>
       <dd>An extension of <xref uid="java.util.Collection" data-throw-if-not-resolved="false">java.util.Collection</xref> that may contain duplicate values like a
           <xref uid="java.util.List" data-throw-if-not-resolved="false">java.util.List</xref>, yet has order-independent equality like a <xref uid="java.util.Set" data-throw-if-not-resolved="false">java.util.Set</xref>.
           One typical use for a multiset is to represent a histogram.
       <dt><xref uid="com.azure.cosmos.implementation.guava25.collect.Multimap" data-throw-if-not-resolved="false">com.azure.cosmos.implementation.guava25.collect.Multimap</xref>
       <dd>A new type, which is similar to <xref uid="java.util.Map" data-throw-if-not-resolved="false">java.util.Map</xref>, but may contain multiple entries
           with the same key. Some behaviors of <xref uid="com.azure.cosmos.implementation.guava25.collect.Multimap" data-throw-if-not-resolved="false">com.azure.cosmos.implementation.guava25.collect.Multimap</xref> are left
           unspecified and are provided only by the subtypes mentioned below.
       <dt><xref uid="com.azure.cosmos.implementation.guava25.collect.ListMultimap" data-throw-if-not-resolved="false">com.azure.cosmos.implementation.guava25.collect.ListMultimap</xref>
       <dd>An extension of <xref uid="com.azure.cosmos.implementation.guava25.collect.Multimap" data-throw-if-not-resolved="false">com.azure.cosmos.implementation.guava25.collect.Multimap</xref> which permits duplicate entries,
           supports random access of values for a particular key, and has <i>partially order-dependent
           equality</i> as defined by <xref uid="com.azure.cosmos.implementation.guava25.collect.ListMultimap#equals(Object)" data-throw-if-not-resolved="false">com.azure.cosmos.implementation.guava25.collect.ListMultimap#equals(Object)</xref>.
           <code>ListMultimap</code> takes its name from the fact that the <xref uid="com.azure.cosmos.implementation.guava25.collect.ListMultimap#get" data-throw-if-not-resolved="false">collection of values</xref> associated with a given
           key fulfills the <xref uid="java.util.List" data-throw-if-not-resolved="false">java.util.List</xref> contract.
       <dt><xref uid="com.azure.cosmos.implementation.guava25.collect.SetMultimap" data-throw-if-not-resolved="false">com.azure.cosmos.implementation.guava25.collect.SetMultimap</xref>
       <dd>An extension of <xref uid="com.azure.cosmos.implementation.guava25.collect.Multimap" data-throw-if-not-resolved="false">com.azure.cosmos.implementation.guava25.collect.Multimap</xref> which has order-independent
           equality and does not allow duplicate entries; that is, while a key may appear twice in a
           <code>SetMultimap</code>, each must map to a different value. <code>SetMultimap</code> takes its name
           from the fact that the <xref uid="com.azure.cosmos.implementation.guava25.collect.SetMultimap#get" data-throw-if-not-resolved="false">collection of
           values</xref> associated with a given key fulfills the <xref uid="java.util.Set" data-throw-if-not-resolved="false">java.util.Set</xref> contract.
       <dt><xref uid="com.azure.cosmos.implementation.guava25.collect.SortedSetMultimap" data-throw-if-not-resolved="false">com.azure.cosmos.implementation.guava25.collect.SortedSetMultimap</xref>
       <dd>An extension of <xref uid="com.azure.cosmos.implementation.guava25.collect.SetMultimap" data-throw-if-not-resolved="false">com.azure.cosmos.implementation.guava25.collect.SetMultimap</xref> for which the <xref uid="com.azure.cosmos.implementation.guava25.collect.SortedSetMultimap#get" data-throw-if-not-resolved="false">collection values</xref> associated with a given
           key is a <xref uid="java.util.SortedSet" data-throw-if-not-resolved="false">java.util.SortedSet</xref>.
       <dt><xref uid="com.azure.cosmos.implementation.guava25.collect.Table" data-throw-if-not-resolved="false">com.azure.cosmos.implementation.guava25.collect.Table</xref>
       <dd>A new type, which is similar to <xref uid="java.util.Map" data-throw-if-not-resolved="false">java.util.Map</xref>, but which indexes its values by an
           ordered pair of keys, a row key and column key.
       <dt><xref uid="com.azure.cosmos.implementation.guava25.collect.ClassToInstanceMap" data-throw-if-not-resolved="false">com.azure.cosmos.implementation.guava25.collect.ClassToInstanceMap</xref>
       <dd>An extension of <xref uid="java.util.Map" data-throw-if-not-resolved="false">java.util.Map</xref> that associates a raw type with an instance of that
           type.
     </dl>

